// components/navbar.js
import React from 'react';
import logoKasa from '../assets/logo_kasa.png';

const Navbar = () => {
  return (
    <div id="navbar">
      <img id="navbar__logo" src={logoKasa} alt="Le logo de Kasa" />
      <div id="navbar__menu">
        <a className="navbar__menu--item" href="#">
          Accueil
        </a>
        <a className="navbar__menu--item" href="#">
          A propos
        </a>
      </div>
    </div>
  );
};

export default Navbar;
